import React from 'react'
import VideoItem from './VideoItem'
const VideoList = (props) => {

    const videoList = props.videos.map((video)  => {
        return <VideoItem  />
    })
    return (
        <>
            {videoList}
        </>
    )
}

export default VideoList;
